import React from 'react';
import logo from './logo.svg';
import './App.css';
import { TrieNode } from './trie';
import { connect } from 'react-redux';
import { fetchStockSearchData } from "./stockSearchActions";

class App extends React.Component {
  componentDidMount() {
    const stockTrie = new TrieNode(undefined, {});
    console.log("here");
    this.props.dispatch(fetchStockSearchData());
  }

  render() {
    return (
      <div className="App">
        <input type="search" id="stockSearch" placeholder="Facebook" />
      </div>
    );
  }
}

const mapStateToProps = (state) => ({
  stocks: state.stocks.items,
});

export default connect(mapStateToProps)(App);
